import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { AppComponent } from './app.component';
import { StudentGridComponent } from './student-grid/student-grid.component';
import { StudentService } from './student.service';
import { StudentPipe } from './student.pipe';
import { FormsModule } from '@angular/forms';

@NgModule({
  declarations: [AppComponent, StudentGridComponent, StudentPipe],
  imports: [BrowserModule, FormsModule],
  providers: [StudentService, StudentPipe],
  exports: [AppComponent, StudentGridComponent],
  bootstrap: [AppComponent],
})
export class AppModule {}
